import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";

const Spots = ({ spot }) => {
  const sortTypes = {
    up: {
      class: "sort-up",
      fn: (a, b) => a.probability - b.probability,
    },
    down: {
      class: "sort-down",
      fn: (a, b) => b.probability - a.probability,
    },
    default: {
      class: "sort",
      fn: (a, b) => a,
    },
  };
  return (
    <>
      {Array.isArray(spot)
        ? spot.map((spot) => (
            <Marker key={spot.id} position={[spot.lat, spot.long]}>
              <Popup>
                <h1>{spot.name}</h1>
                <h3>{spot.country}</h3>
                <p>
                  WIND PROBABILITY
                  <br />
                  {spot.probability}%
                </p>
                <p>
                  LONGITUDE:
                  <br />
                  {spot.long}
                </p>
                <p>
                  LATITUDE:
                  <br />
                  {spot.lat}
                </p>
                <p>
                  WHEN TO GO:
                  <br />
                  {spot.month}
                </p>
              </Popup>
            </Marker>
          ))
        : null}
    </>
  );
};

export default Spots;
